import React from 'react';
import './App.css';
import Card from './Components/Card';

function App() {
  return (
    <div className="card-container">
      <Card parkName="Central Park" location="New York City, New York" availibility="Court 1: Open" />
      <Card parkName="Golden Gate Park" location="San Francisco, California" availibility="Court 2: Closed" />
      <Card parkName="Hyde Park" location="London, UK" availibility="Court 3: Open" />
    </div>
  );
}

export default App;
